import React, { useState, useEffect } from 'react';

// URL
import { allAssistants } from '../../../settings';

// Styles
import { MyBody, assistantTable } from './AssistantEndpoint.styles';

const AssistantEndpoint = () => {
  const [assistants, setAssistants] = useState([{}]);


  return (
    <MyBody>
      <UserTable>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Username</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Website</th>
          </tr>
        </thead>
        <tbody>
        </tbody>
      </UserTable>
    </MyBody>
  );
};

export default AssistantEndpoint;
